const MUSIC_ENABLED: bool = true;
const DEBUG: bool = false;
const REST: u8 = 0xFF;
const SPEED: u32 = 7;
pub static mut FRAME: *mut u8 = 0xFFFF as *mut u8;
pub static mut SECONDS: *mut u16 = 0xFFFD as *mut u16;
pub static mut LEAD_A: *mut [u8; 128] = 0x19A0 as *mut [u8; 128];
pub static mut LEAD_B: *mut [u8; 128] = 0x1A20 as *mut [u8; 128];
pub static mut BASS_A: *mut [u8; 32] = 0x1AA0 as *mut [u8; 32];
pub static mut BASS_B: *mut [u8; 32] = 0x1AC0 as *mut [u8; 32];

#[derive(Copy, Clone, PartialEq, Eq, PartialOrd, Ord)]
pub struct Note {
    index: u8,
}

impl Note {
    pub fn new(index: u8) -> Self {
        Note { index }
    }

    pub fn freq(&self) -> u32 {
        (261.64 * (2_f64.powf(self.index as f64 / 12.0))).round() as u32
    }

    pub fn octave_freq(&self, octave: i16) -> u32 {
        (261.64 * (2_f64.powf((self.index as i16 + octave * 12) as f64 / 12.0))).round() as u32
    }
}

fn get_frame() -> u8 {
    unsafe { *FRAME }
}

fn get_total_frames() -> u32 {
    unsafe { (*FRAME as u32) + (*SECONDS as u32) * 60 }
}

fn get_anim_frame() -> usize {
    (get_total_frames() / 4) as usize % IMAGE.len()
}

fn get_seconds() -> u16 {
    unsafe { *SECONDS }
}

fn get_note_ticks() -> u32 {
    get_total_frames() / SPEED
}

fn get_song_section() -> u32 {
    (get_note_ticks() / 128) % 2
}

fn is_note_tick() -> bool {
    get_total_frames() % SPEED == 0
}

fn tick() {
    let frame = get_frame() + 1;
    let seconds = get_seconds() + (frame / 60) as u16;
    unsafe {
        *FRAME = frame % 60;
        *SECONDS = seconds;
    }
}

fn get_note(section: *mut [u8]) -> Option<Note> {
    if is_note_tick() {
        let song = unsafe { &*section };
        let note_index = song[get_note_ticks() as usize % song.len()];
        if note_index != REST {
            return Some(Note::new(note_index));
        }
    }
    None
}

fn load_song() {
    unsafe {
        *LEAD_A = [
            19, REST, 21, REST, 16, 16, REST, 12, 15, 14, 12, REST, 12, REST, 14, REST, 15, REST,
            15, 14, 12, 14, 16, 19, 21, 16, 19, 14, 16, 12, 14, 12, 16, REST, 19, REST, 21, 16, 19,
            14, 16, 12, 15, 16, 15, 14, 12, 14, 15, REST, 12, 14, 16, 19, 14, 16, 14, 12, 14, REST,
            12, REST, 14, REST, 19, REST, 21, REST, 16, 16, REST, 12, 15, 14, 12, REST, 12, REST,
            14, REST, 15, REST, 15, 14, 12, 14, 16, 19, 21, 16, 19, 14, 16, 12, 14, 12, 16, REST,
            19, REST, 21, 16, 19, 14, 16, 12, 15, 16, 15, 14, 12, 14, 15, REST, 12, 14, 16, 19, 14,
            16, 14, 12, 14, REST, 12, REST, 14, REST,
        ];

        *BASS_A = [
            5, REST, 17, REST, 7, REST, 19, REST, 4, REST, 16, REST, 9, REST, 21, REST, 2, REST,
            14, REST, 7, REST, 19, REST, 0, REST, 12, REST, 0, REST, 12, REST,
        ];

        *LEAD_B = [
            12, REST, 7, 9, 12, REST, 7, 9, 12, 14, 16, 12, 17, 16, 17, 19, 12, REST, 12, REST, 7,
            9, 12, 7, 17, 16, 14, 12, 7, 4, 5, 7, 12, REST, 7, 9, 12, REST, 7, 9, 12, 12, 14, 16,
            12, 7, 9, 7, 12, REST, 12, 11, 12, 7, 9, 12, 17, 16, 17, 19, 12, REST, 11, REST, 12,
            REST, 7, 9, 12, REST, 7, 9, 12, 14, 16, 12, 17, 16, 17, 19, 12, REST, 12, REST, 7, 9,
            12, 7, 17, 16, 14, 12, 7, 4, 5, 7, 12, REST, 7, 9, 12, REST, 7, 9, 12, 12, 14, 16, 12,
            7, 9, 7, 12, REST, 12, 11, 12, 7, 9, 12, 17, 16, 17, 19, 12, REST, 14, REST,
        ];

        *BASS_B = [
            5, REST, 9, REST, 12, REST, 17, REST, 4, REST, 7, REST, 12, REST, 16, REST, 2, REST, 5,
            REST, 9, REST, 14, REST, 0, REST, 4, REST, 7, REST, 12, REST,
        ];
    }
}

#[no_mangle]
fn start() {
    unsafe {
        (*PALETTE).reverse();
    }
    load_song();
}

#[no_mangle]
fn update() {
    if MUSIC_ENABLED {
        let (lead_note, bass_note) = match get_song_section() {
            0 => unsafe { (get_note(LEAD_A), get_note(BASS_A)) },
            _ => unsafe { (get_note(LEAD_B), get_note(BASS_B)) },
        };
        if let Some(note) = lead_note {
            let duration = 6;
            let volume = 80;
            tone(note.freq(), duration, volume, TONE_PULSE1 | TONE_MODE4);
        }
        if let Some(note) = bass_note {
            let duration = 10;
            let volume = 40;
            tone(note.octave_freq(-2), duration, volume, TONE_TRIANGLE);
        }

        // Drums
        if is_note_tick() {
            match get_note_ticks() % 8 {
                // Kick
                0 => tone(32, 2, 100, TONE_PULSE2 | TONE_MODE4),
                // Snare
                4 => {
                    tone(32, 2, 80, TONE_PULSE2 | TONE_MODE4);
                    tone(800 | 700 << 16, 7, 40, TONE_NOISE);
                }
                // // Hat
                2 | 6 => tone(3000, 2, 40, TONE_NOISE),
                _ => {}
            }
        }
    }

    unsafe {
        *DRAW_COLORS = 0x2413;
    }

    blit(&(IMAGE[get_anim_frame()]), 0, 59, 120, 42, BLIT_2BPP);

    if DEBUG {
        text(format!("FRAME:    {:03}", get_frame()), 0, 0);
        text(format!("SECONDS:  {:05}", get_seconds()), 0, 8);
        text(format!("SECTION:  {:05}", get_song_section()), 0, 16);
        text(format!("TICKS:    {:05}", get_note_ticks()), 0, 24);
    } else {
        unsafe {
            *DRAW_COLORS = 0x03;
        }
        text("Nyan Cat!", 44, 4);
    }

    tick();
}

#[test]
fn test_note_freq() {
    // C4
    assert_eq!(Note::new(0).freq(), 261);
    // G4
    assert_eq!(Note::new(7).freq(), 784);
    // G5
    assert_eq!(Note::new(19).freq(), 1568);
}
